// draws the score on the vga using the appropriate array
void draw_score(int score) { 
	for (int x = 0; x < 6; x++) {	// each score array is 6x6
		for (int y = 0; y < 6; y++) {	
			if (score == 0) {
				plot_pixel(x + 313, y, zero[y][x]);
			}
			else if (score == 1) {
				plot_pixel(x + 313, y, one[y][x]);
			}
			else if (score == 2) {
				plot_pixel(x + 313, y, two[y][x]);
			}
			else if (score == 3) {
				plot_pixel(x + 313, y, three[y][x]);
			}
			else if (score == 4) {
				plot_pixel(x + 313, y, four[y][x]);
			}
			else if (score == 5) {
				plot_pixel(x + 313, y, five[y][x]);
			}
		}
	}
}

// draws the final score array and the score
void draw_final_score(int score) {
	for (int x = 0; x < 60; x++) {
		for (int y = 0; y < 6; y++) {
			plot_pixel(x + 253, y, final_score_array[y][x]);
		}
	}
	draw_score(score);
}

