// audio device address structure
struct audio_t {
  volatile unsigned int control;
  volatile unsigned char rarc;
  volatile unsigned char ralc;
  volatile unsigned char wsrc;
  volatile unsigned char wslc;
  volatile unsigned int ldata;
  volatile unsigned int rdata;
};

struct audio_t *const audiop = ((struct audio_t *)0xff203040); // global variable for the audio device pointer

// plays the audio array inputted with the indicated sample amount
void audio_play(int *samples, int n) {
  audiop->control = 0x8;  // clear the output FIFOs
  audiop->control = 0x0;  // resume input conversion
  for (int i = 0; i < n; i++) {
    // output data if there is space in the output FIFOs
    while (audiop->wsrc == 0);
    audiop->ldata = samples[i];
    audiop->rdata = samples[i];
  }
}

short int Buffer1[240][512];  // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];

void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // base address
  int status;
  *pixel_ctrl_ptr = 1;  // start the synchronization process
  // write 1 into front buffer address register
  status = *(pixel_ctrl_ptr + 3);  // read the status register
  while ((status & 0x01) != 0)     // polling loop waiting for S bit to go to 0
  {
    status = *(pixel_ctrl_ptr + 3);
  }  // loop/function exits when status bit goes to 0
}

// clears the screen to all black
void clear_screen() {
  int y, x;
  for (x = 0; x < 320; x++)
    for (y = 0; y < 240; y++) plot_pixel(x, y, 0);
}

// polls keyboard for input
char pollKeyboard() {
  int PS2_data = *(Keyboard);
  int RVALID = PS2_data & 0x8000;
  if (RVALID) {
    byte1 = byte2;
    byte2 = byte3;
    byte3 = PS2_data & 0xFF;
  }
  if (byte2 == (char)0xF0 || byte2 == (char)0xE0) {
    return byte3;
  }
}

// draws line with indicated start and end and colour
void draw_line(int x0, int y0, int x1, int y1, short int line_color) {
  int temp = 0;
  int is_steep = abs(y1 - y0) > abs(x1 - x0);
  if (is_steep) {
    temp = x0;
    x0 = y0;
    y0 = temp;
    temp = x1;
    x1 = y1;
    y1 = temp;
  }
  if (x0 > x1) {
    temp = x0;
    x0 = x1;
    x1 = temp;
    temp = y0;
    y0 = y1;
    y1 = temp;
  }
  int y_step;
  int deltax = x1 - x0;
  int deltay = abs(y1 - y0);
  int error = -(deltax / 2);
  int y = y0;
  if (y0 < y1) {
    y_step = 1;
  } else {
    y_step = -1;
  }

  for (int x = x0; x <= x1; x++) {
    if (is_steep) {
      plot_pixel(y, x, line_color);
    } else {
      plot_pixel(x, y, line_color);
    }
    error = error + deltay;
    if (error > 0) {
      y = y + y_step;
      error = error - deltax;
    }
  }
}

void draw_block(int start_x, int start_y, int width, int height,
                short int line_color) {
  for (int x = 0; x < width; x++) {
    for (int y = 0; y < height; y++) {
      plot_pixel(start_x + x, start_y + y, line_color);
    }
  }
}
// 0x7BEF is dark gray
void draw_claw(int start_x, int start_y, short int line_color) {
  int scale = 4;  // scale

  // stem of the claw
  int stem_width = 4 * scale;
  int stem_height = 5 * scale;
  draw_block(start_x, start_y, stem_width, stem_height, line_color);

  // left finger
  draw_block(start_x - 2 * scale, start_y + stem_height - 2 * scale, 2 * scale,
             2 * scale, line_color);
  draw_block(start_x - 3 * scale, start_y + stem_height - 1 * scale, 2 * scale,
             2 * scale, line_color);
  draw_block(start_x - 4 * scale, start_y + stem_height, 2 * scale, 5 * scale,
             line_color);
  draw_block(start_x - 3 * scale, start_y + stem_height + 4 * scale, 2 * scale,
             2 * scale, line_color);

  // right finger
  draw_block(start_x + stem_width, start_y + stem_height - 2 * scale, 2 * scale,
             2 * scale, line_color);
  draw_block(start_x + stem_width + 1 * scale,
             start_y + stem_height - 1 * scale, 2 * scale, 2 * scale,
             line_color);
  draw_block(start_x + stem_width + 2 * scale, start_y + stem_height, 2 * scale,
             5 * scale, line_color);
  draw_block(start_x + stem_width + 1 * scale,
             start_y + stem_height + 4 * scale, 2 * scale, 2 * scale,
             line_color);
}

void draw_closed_claw(int start_x, int start_y, short int line_color) {
  int scale = 4;  // scale

  // stem of the claw
  int stem_width = 4 * scale;
  int stem_height = 5 * scale;
  draw_block(start_x, start_y, stem_width, stem_height, line_color);

  // left finger
  draw_block(start_x - 2 * scale, start_y + stem_height - 2 * scale, 2 * scale,
             2 * scale, line_color);
  draw_block(start_x - 3 * scale, start_y + stem_height - 1 * scale, 2 * scale,
             6 * scale, line_color);
  draw_block(start_x - 2 * scale, start_y + stem_height + 4 * scale, 2 * scale,
             2 * scale, line_color);

  // right finger
  draw_block(start_x + stem_width, start_y + stem_height - 2 * scale, 2 * scale,
             2 * scale, line_color);
  draw_block(start_x + stem_width + 1 * scale,
             start_y + stem_height - 1 * scale, 2 * scale, 6 * scale,
             line_color);
  draw_block(start_x + stem_width, start_y + stem_height + 4 * scale, 2 * scale,
             2 * scale, line_color);
}

int main(void) {
  int scale = 4;
  int buffer = 1;
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  volatile int *LEDR_ptr = (int *)0xFF200000;
  volatile int *HEX_ptr = (int *)0xFF200020;
  volatile int *Buttons = (int *)0xFF200050;
  volatile int *Switches = (int *)0xFF200040;
  int value;
  int switches;
  int prize_x[5], prize_y[5];
  int prize_x2[5], prize_y2[5];
  int colour_box[5];
  int colour[10] = {0xffff, 0xf800, 0x07e0, 0x001f, 0x07FF,
                    0xF81F, 0xFFE0, 0xFB80, 0xFDDD, 0xBFE0};
  prize_x[0] = rand() % ((70 * scale) + 1 - (62 * scale)) + (62 * scale);
  prize_x[1] = rand() % ((58 * scale) + 1 - (52 * scale)) + (52 * scale);
  prize_x[2] = rand() % ((48 * scale) + 1 - (42 * scale)) + (42 * scale);
  prize_x[3] = rand() % ((38 * scale) + 1 - (32 * scale)) + (32 * scale);
  prize_x[4] = rand() % ((30 * scale) + 1 - (22 * scale)) + (22 * scale);
  for (int i = 0; i < 5; i++) {
    prize_y[i] = 240 - 4 * scale;
    prize_x2[i] = prize_x[i];
    prize_y2[i] = prize_y[i];
    colour_box[i] = colour[rand() % 10];
  }
  int claw_x = 5 * scale;
  int claw_x2 = claw_x;
  int claw_y = 0;
  int claw_y2 = claw_y;
  int done = 0;
  int fail = 0;
  int win = 0;
  int start = 0;
  int gameover = 0;
  int lost = 0;
  int lose_sound = 0;
  int win_sound = 0;
  int prize = 0;
  int prizeNum = 0;
  int hardmode = 0;
  int size = 4;
  int score = 0;
  int final_score = 0;

  /* set front pixel buffer to Buffer 1 */
  *(pixel_ctrl_ptr + 1) =
      (int)&Buffer1;  // first store the address in the  back buffer
  /* now, swap the front/back buffers, to set the front buffer location */
  wait_for_vsync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
  pixel_buffer_start = *pixel_ctrl_ptr;
  clear_screen();  // pixel_buffer_start points to the pixel buffer

  /* set back pixel buffer to Buffer 2 */
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // we draw on the back buffer
  clear_screen();  // pixel_buffer_start points to the pixel buffer
  while (1) {
    if (start == 0) {  // havent started game yet, display start page
      start_page();
    }
    if (lose_sound == 1) {  // if lose sound should be played
      audio_play(loss_audio, number_of_loss_samples);
      lose_sound = 0;
    }
    char key = pollKeyboard();
    if (key == (char)0x26) {  // check if user pressed number 3
      clear_screen();
      if (gameover == 1 || start == 0) {  // check if user selected hard mode
        switches = *Switches;
        if (switches == 1) {  // bigger box size if on hard mode
          hardmode = 1;
          size = 5;
        } else {
          hardmode = 0;
          size = 4;
        }
        if (hardmode == 0) {  // different prize locations based on size of box
          prize_x[0] =
              rand() % ((70 * scale) + 1 - (62 * scale)) + (62 * scale);
          prize_x[1] =
              rand() % ((58 * scale) + 1 - (52 * scale)) + (52 * scale);
          prize_x[2] =
              rand() % ((48 * scale) + 1 - (42 * scale)) + (42 * scale);
          prize_x[3] =
              rand() % ((38 * scale) + 1 - (32 * scale)) + (32 * scale);
          prize_x[4] =
              rand() % ((30 * scale) + 1 - (22 * scale)) + (22 * scale);
          for (int i = 0; i < 5; i++) {
            prize_y[i] = 240 - size * scale;
            prize_x2[i] = prize_x[i];
            prize_y2[i] = prize_y[i];
            colour_box[i] = colour[rand() % 10];
          }
        } else {
          prize_x[0] =
              rand() % ((70 * scale) + 1 - (65 * scale)) + (65 * scale);
          prize_x[1] =
              rand() % ((59 * scale) + 1 - (54 * scale)) + (54 * scale);
          prize_x[2] =
              rand() % ((48 * scale) + 1 - (43 * scale)) + (43 * scale);
          prize_x[3] =
              rand() % ((37 * scale) + 1 - (33 * scale)) + (33 * scale);
          prize_x[4] =
              rand() % ((27 * scale) + 1 - (22 * scale)) + (22 * scale);
          for (int i = 0; i < 5; i++) {
            prize_y[i] = 240 - size * scale;
            prize_x2[i] = prize_x[i];
            prize_y2[i] = prize_y[i];
            colour_box[i] = colour[rand() % 10];
          }
        }
        claw_x = 5 * scale;
        claw_x2 = claw_x;
        claw_y = 0;
        claw_y2 = claw_y;
        gameover = 0;
      }
      start = 1;
    }
    if (gameover ==
        1) {  // player won the game, show final screen components, reset stats
      clear_screen();
      all_prizes_message();
      play_again_message();
      draw_final_score(final_score);
      prizeNum = 0;
      score = 0;
    }
    if (win_sound == 1) {  // win sound if player gets a prize
      audio_play(win_audio, number_of_win_samples);
      win_sound = 0;
    }
    if (start == 1 && gameover == 0) {  // if game has started and its not over
      draw_block(14 * scale, 240 - 45 * scale, 2 * scale, 45 * scale,
                 0xFFFF);              // claw machine border
      if (buffer == 1) {               // first buffer
        draw_score(score);             // display score
        for (int i = 0; i < 5; i++) {  // erase components from last buffer
          draw_block(prize_x[i], prize_y[i], size * scale, size * scale, 0);
        }
        draw_claw(claw_x, claw_y, 0);
        draw_closed_claw(claw_x, claw_y, 0);
        claw_x = claw_x2;  // update locations
        claw_y = claw_y2;
        for (int i = 0; i < 5; i++) {
          prize_x[i] = prize_x2[i];
          prize_y[i] = prize_y2[i];
        }
        char key = pollKeyboard();  // check for keyboard input
        if (key == (char)0x23 && claw_x < 320 - 9 * scale && claw_y == 0 &&
            fail == 0 && win == 0) {  // if its D
          claw_x++;
        }
        if (key == (char)0x1C && claw_x > 5 * scale && claw_y == 0 &&
            fail == 0 && win == 0) {  // if its A
          claw_x--;
        }
        if (key == (char)0x1B && fail == 0 && claw_x > 20 * scale &&
            win == 0) {  // if its S
          done = 1;      // boolean to tell when claw should go down
        }
        if (done == 1 &&
            claw_y < 240 - 12 * scale) {  // claw going down until at the bottom
          claw_y++;
        }
        if (claw_y >= 240 - 12 * scale) {  // when at bottom
          for (int i = 0; i < 5;
               i++) {  // check if prize is within claw, based on difficulty
            if (hardmode == 0) {
              if (claw_x < prize_x[i] - scale || claw_x > prize_x[i] + scale) {
                fail = 1;
                done = 0;
              } else {
                prizeNum++;
                win = 1;
                fail = 0;
                done = 0;
                prize = i;
                break;
              }
            } else {
              if (claw_x < prize_x[i] || claw_x > prize_x[i] + scale) {
                fail = 1;
                done = 0;
              } else {
                prizeNum++;
                win = 1;
                fail = 0;
                done = 0;
                prize = i;
                break;
              }
            }
          }
        }
        if (fail == 1) {     // if it missed
          if (claw_y > 0) {  // retract claw
			draw_claw(claw_x, claw_y, 0);
            claw_y--;
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x[i], prize_y[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
            draw_closed_claw(claw_x, claw_y, 0x7BEF);
          } else {  // if retracted to the top already, move it back to start
                    // (left)
			draw_claw(claw_x, claw_y, 0);
            claw_x--;
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x[i], prize_y[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
            draw_closed_claw(claw_x, claw_y, 0x7BEF);

            if (claw_x <= 5 * scale) {  // if claw back to start, open claw, and
                                        // play lose sound
              draw_closed_claw(claw_x, claw_y, 0);
              draw_claw(claw_x, claw_y, 0x7BEF);
              lose_sound = 1;
              if (score > 0) {  // subtract one from score if it is above 0
                score--;
              }
              fail = 0;
            }
          }
        } else if (win == 1) {  // if caught prize
          draw_block(prize_x[prize], prize_y[prize], size * scale, size * scale,
                     0);
          if (claw_y > 0) {       // if claw hasnt retracted to top yet
            if (hardmode == 0) {  // redraw prize at the middle of the claw (as
                                  // if claw picked it up)
              prize_x[prize] = claw_x;
            } else {
              prize_x[prize] = claw_x - 0.5 * scale;
            }
            draw_claw(claw_x, claw_y, 0);			  
            claw_y--;  // claw and prize rise back up
            prize_y[prize]--;
            draw_closed_claw(claw_x, claw_y, 0x7BEF);
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x[i], prize_y[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
          } else if (claw_x >
                     5 * scale) {  // if claw back at the top, move to the left
			draw_claw(claw_x, claw_y, 0);
            claw_x--;
            prize_x[prize]--;
            draw_closed_claw(claw_x, claw_y, 0x7BEF);
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x[i], prize_y[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
          } else if (claw_x <= 5 * scale &&
                     prize_y[prize] <
                         240 - size * prizeNum *
                                   scale) {  // if claw back to left, prize now
                                             // dropping down until furthest
                                             // down or on top of other prizes
			draw_claw(claw_x, claw_y, 0);
            prize_y[prize] += 4;
            draw_claw(claw_x, claw_y, 0x7BEF);
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x[i], prize_y[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
            if (prize_y[prize] ==
                240 - size * prizeNum *
                          scale) {  // when prize reaches bottom, win sound
              win = 0;
              win_sound = 1;
              score++;              // score goes up
              if (prizeNum == 5) {  // if all prizes received, game is over
                gameover = 1;
                final_score = score;
              }
            }
          }
        } else {  // drawing claw
          draw_claw(claw_x, claw_y, 0x7BEF);
          for (int i = 0; i < 5; i++) {
            draw_block(prize_x[i], prize_y[i], size * scale, size * scale,
                       colour_box[i]);  // prizes
          }
        }
        draw_block(claw_x, 0, 4 * scale, claw_y, 0x7BEF);  // claw stem
      }

      if (buffer == -1) {  // same as buffer 1 but with new arrays of values so
                           // there are no tearing
        draw_score(score);
        for (int i = 0; i < 5; i++) {
          draw_block(prize_x2[i], prize_y2[i], size * scale, size * scale,
                     0);  // prizes
        }
        draw_claw(claw_x2, claw_y2, 0);
        draw_closed_claw(claw_x2, claw_y2, 0);
        claw_x2 = claw_x;
        claw_y2 = claw_y;
        for (int i = 0; i < 5; i++) {
          prize_x2[i] = prize_x[i];
          prize_y2[i] = prize_y[i];
        }
        char key = pollKeyboard();
        if (key == (char)0x23 && claw_x2 < 320 - 9 * scale && claw_y2 == 0 &&
            fail == 0 && win == 0) {
          claw_x2++;
        }
        if (key == (char)0x1C && claw_x2 > 6 * scale && claw_y2 == 0 &&
            fail == 0 && win == 0) {
          claw_x2--;
        }
        if (key == (char)0x1B && fail == 0 && claw_x > 20 * scale && win == 0) {
          done = 1;
        }
        if (done == 1 && claw_y2 < 240 - 12 * scale) {
          claw_y2++;
        }
        if (claw_y2 >= 240 - 12 * scale) {
          for (int i = 0; i < 5; i++) {
            if (hardmode == 0) {
              if (claw_x2 < prize_x2[i] - scale ||
                  claw_x2 > prize_x2[i] + scale) {
                fail = 1;
                done = 0;
              } else {
                prizeNum++;
                win = 1;
                fail = 0;
                done = 0;
                prize = i;
                break;
              }
            } else {
              if (claw_x2 < prize_x2[i] || claw_x2 > prize_x2[i] + scale) {
                fail = 1;
                done = 0;
              } else {
                prizeNum++;
                win = 1;
                fail = 0;
                done = 0;
                prize = i;
                break;
              }
            }
          }
        }
        if (fail == 1) {
          if (claw_y2 > 0) {
            draw_claw(claw_x2, claw_y2, 0);
            claw_y2--;
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x2[i], prize_y2[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
            draw_closed_claw(claw_x2, claw_y2, 0x7BEF);
          } else {
            draw_claw(claw_x2, claw_y2, 0);
            claw_x2--;
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x2[i], prize_y2[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
            draw_closed_claw(claw_x2, claw_y2, 0x7BEF);
            if (claw_x2 <= 5 * scale) {
              draw_closed_claw(claw_x2, claw_y2, 0);
              draw_claw(claw_x2, claw_y2, 0x7BEF);
              lose_sound = 1;
              if (score > 0) {
                score--;
              }
              fail = 0;
            }
          }
        } else if (win == 1) {
          draw_block(prize_x2[prize], prize_y2[prize], size * scale,
                     size * scale, 0);
          if (claw_y2 > 0) {
            if (hardmode == 0) {
              prize_x2[prize] = claw_x2;
            } else {
              prize_x2[prize] = claw_x2 - 0.5 * scale;
            }
            draw_claw(claw_x2, claw_y2, 0);
            claw_y2--;
            prize_y2[prize]--;
            draw_closed_claw(claw_x2, claw_y2, 0x7BEF);
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x2[i], prize_y2[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
          } else if (claw_x2 > 5 * scale) {
            draw_claw(claw_x2, claw_y2, 0);
            claw_x2--;
            prize_x2[prize]--;
            draw_closed_claw(claw_x2, claw_y2, 0x7BEF);
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x2[i], prize_y2[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
          } else if (claw_x <= 5 * scale &&
                     prize_y2[prize] < 240 - size * prizeNum * scale) {
            draw_claw(claw_x2, claw_y2, 0);
            prize_y2[prize] += 4;
            draw_claw(claw_x2, claw_y2, 0x7BEF);
            for (int i = 0; i < 5; i++) {
              draw_block(prize_x2[i], prize_y2[i], size * scale, size * scale,
                         colour_box[i]);  // prizes
            }
            if (prize_y2[prize] == 240 - size * prizeNum * scale) {
              win = 0;
              win_sound = 1;
              score++;
              if (prizeNum == 5) {
                gameover = 1;
                final_score = score;
              }
            }
          }
        } else {
          draw_claw(claw_x2, claw_y2, 0x7BEF);
          for (int i = 0; i < 5; i++) {
            draw_block(prize_x2[i], prize_y2[i], size * scale, size * scale,
                       colour_box[i]);  // prizes
          }
        }
        draw_block(claw_x2, 0, 4 * scale, claw_y2, 0x7BEF);
      }

      buffer *= -1;
    }
    wait_for_vsync();  // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
  }
}
